const long long MOD = 1e9 + 7;
const long long MAXN = 1e6 + 1;
using namespace std;

typedef long long ll;

long long readInt() {
    bool minus1 = false;
    long long result = 0;
    char ch;
    ch = getchar();
    while (true) {
        if (ch == '-') break;
        if (ch >= '0' && ch <= '9') break;
        ch = getchar();
    }
    if (ch == '-') minus1 = true; else result = ch-'0';
    while (true) {
        ch = getchar();
        if (ch < '0' || ch > '9') break;
        result = result*10 + (ch - '0');
    }
    if (minus1)
        return -result;
    else
        return result;
}
bool ch(pair <int, int> a, pair <int, int> b) {
	/*
	a.F   b.F
    --- < ---
    a.s   b.S
    */
    return a.F * b.S < b.F * a.S;
}


int main() {
	#ifdef IZI_KATKA
	assert(freopen("input", "r", stdin));
    assert(freopen("output", "w", stdout));
    #endif
	vector<pair <int, int> > kek;    
    int n = readInt(), p = readInt(), q = readInt();
    for (int j = 1; j <= n; j++) {
    	for (int i = 1; i <= j; i++) {
    		if (j < i * p && i * q < j && __gcd(i, j) == 1) {
				kek.pb({i, j});    					
    		} 
    	}
    }
    sort(kek.begin(), kek.end(), ch);
    for (auto i : kek) {
		cout << i.F << '/' << i.S << endl;
    }
    return 0;
}